import React, { Component } from "react";

class Timeline extends Component {
  state = {
    events: [
      { id: "event1", title: "foo", text: "bar", detailsArray: ["abc", "bcd"] },
      { id: "event2", title: "foo1", text: "bar1" }
    ]
  };
  render() {
    return <div class="container py-2" />;
  }
}

export default Timeline;
